#undef SendMessage
bool SendMMHello1()
{
	CMsgGCCStrike15_v2_MatchmakingClient2GCHello Message;
	void* ptr = malloc(Message.ByteSize() + 8);
	if (!ptr)
		return false;

	auto unMsgType = k_EMsgGCCStrike15_v2_MatchmakingClient2GCHello | ((DWORD)1 << 31);
	((uint32_t*)ptr)[0] = unMsgType;
	((uint32_t*)ptr)[1] = 0;

	Message.SerializeToArray((void*)((DWORD)ptr + 8), Message.ByteSize());

	bool result = SDK::Interfaces::SteamGameCoordinator()->SendMessage(k_EMsgGCCStrike15_v2_MatchmakingClient2GCHello | ((DWORD)1 << 31), ptr, Message.ByteSize() + 8) == k_EGCResultOK;

	free(ptr);
	return result;
}
bool SendClientHello1()
{
	CMsgClientHello Message;

	Message.set_client_session_need(1);
	Message.clear_socache_have_versions();

	void* ptr = malloc(Message.ByteSize() + 8);

	if (!ptr)
		return false;

	((uint32_t*)ptr)[0] = k_EMsgGCClientHello | ((DWORD)1 << 31);
	((uint32_t*)ptr)[1] = 0;

	Message.SerializeToArray((void*)((DWORD)ptr + 8), Message.ByteSize());

	bool result = SDK::Interfaces::SteamGameCoordinator()->SendMessage(k_EMsgGCClientHello | ((DWORD)1 << 31), ptr, Message.ByteSize() + 8) == k_EGCResultOK;

	free(ptr);

	return result;
}
void CFoxSystem::PostRetrieveMessage(uint32_t* punMsgType, void* pubDest, uint32_t cubDest, uint32_t* pcubMsgSize)
{
	static bool isinited = false;

	
	uint32_t MessageType = *punMsgType & 0x7FFFFFFF;
	if (MessageType == k_EMsgGCCStrike15_v2_MatchmakingGC2ClientHello && ProfileChanger::enabled) {
		CMsgGCCStrike15_v2_MatchmakingGC2ClientHello Message;
		try
		{
			if (!Message.ParsePartialFromArray((void*)((DWORD)pubDest + 8), *pcubMsgSize - 8))
				return;
		}
		catch (...)
		{
			return;
		}
		/*if (Settings::ProfileChanger::ban != 0) {
			Message.set_penalty_reason(Settings::ProfileChanger::ban);
			Message.set_penalty_seconds(Settings::ProfileChanger::time);
		}*/
		if (ProfileChanger::level != 0) {
			Message.set_player_level(ProfileChanger::level);
		}
		if (ProfileChanger::xp != 0) {
			Message.set_player_cur_xp(ProfileChanger::xp);
			
		}
		PlayerRankingInfo* Ranking = Message.mutable_ranking();

		Ranking->set_account_id(SDK::Interfaces::SteamUser()->GetSteamID().GetAccountID());
		
		if (ProfileChanger::rank_id != 0) {
			Ranking->set_rank_id(ProfileChanger::rank_id);
		}
		if (ProfileChanger::wins != 0) {
			Ranking->set_wins(ProfileChanger::wins);
		}
		PlayerCommendationInfo* Commendation = Message.mutable_commendation();



		if (ProfileChanger::cmd_friendly != 0) {
			Commendation->set_cmd_friendly(ProfileChanger::cmd_friendly);
		}
		if (ProfileChanger::cmd_leader != 0) {
			Commendation->set_cmd_leader(ProfileChanger::cmd_leader);
		}
		if (ProfileChanger::cmd_teaching != 0) {
			Commendation->set_cmd_teaching(ProfileChanger::cmd_teaching);
		}
		if ((uint32_t)Message.ByteSize() <= cubDest - 8)
		{
			Message.SerializeToArray((void*)((DWORD)pubDest + 8), Message.ByteSize());
			*pcubMsgSize = Message.ByteSize() + 8;
		}
	}

	if (MessageType == k_EMsgGCClientWelcome) {
		CMsgClientWelcome Message;
		try
		{
			if (!Message.ParsePartialFromArray((void*)((DWORD)pubDest + 8), *pcubMsgSize - 8))
				return;
		}
		catch (...)
		{
			return;
		}
		if (Message.outofdate_subscribed_caches_size() <= 0)
			return;
		CMsgSOCacheSubscribed* Cache = Message.mutable_outofdate_subscribed_caches(0);
		for (int i = 0; i < Cache->objects_size(); i++)
		{
			CMsgSOCacheSubscribed::SubscribedType* Object = Cache->mutable_objects(i);
			if (!Object->has_type_id())
				continue;
			if (Object->type_id() == 1) {
				for (int j = 0; j < Object->object_data_size(); j++)
				{
					std::string* ObjectData = Object->mutable_object_data(j);
					CSOEconItem Item;
					if (!Item.ParseFromArray((void*)const_cast<char*>(ObjectData->data()), ObjectData->size()))
						continue;
					if (Item.equipped_state_size() <= 0)
						continue;
					if (MedalChanger::equipped_medal_override)
					{
						CSOEconItemEquipped* EquippedState = Item.mutable_equipped_state(0);
						if (EquippedState->new_class() == 0 && EquippedState->new_slot() == 55)
						{
							Item.clear_equipped_state();
							ObjectData->resize(Item.ByteSize());
							Item.SerializeToArray((void*)const_cast<char*>(ObjectData->data()), Item.ByteSize());
						}
					}
				}
				/*ApplyMedals(Object);
				ApplySkins(Object);*/
				ApplySkins(Object);
				//ApplyMedals(Object);
			}
		}
		if ((uint32_t)Message.ByteSize() <= cubDest - 8)
		{
			Message.SerializeToArray((void*)((DWORD)pubDest + 8), Message.ByteSize());
			*pcubMsgSize = Message.ByteSize() + 8;
		}
	}
	if (!isinited)
	{
		isinited = true;
		/*SendMMHello1();
		SendClientHello1();*/
	}

}


