CMatchFramework *g_MatchFramework;

static void ChangeRanks(int rank)
{

	KeyValues* kv = reinterpret_cast<KeyValues*>(KeyValues::operator new(36));

	kv->InitKeyValues("Update");

	auto session_setting = g_MatchFramework->GetMatchSession()->GetSessionSettings();
	auto members = session_setting->FindKey("Members");
	if (members)
	{
		auto size = members->GetInt("numMachines", 0);
		for (int i = 0; i < size; ++i)
		{
			std::string machine = "machine" + std::to_string(i);
			auto machine_key = members->FindKey(machine.c_str());
			if (machine_key)
			{
				auto num_players = machine_key->GetInt("numPlayers", 0);
				for (int x = 0; x < num_players; ++x)
				{
					std::string player = "player" + std::to_string(x);
					auto player_key = machine_key->FindKey(player.c_str());
					if (player_key)
						kv->SetInt(std::string("Update/Members/" + machine + "/" + player + "/game/ranking").c_str(), rank);
				}
			}
		}
	}
	g_MatchFramework->GetMatchSession()->UpdateSessionSettings(kv);
	delete kv;

}
void SendLobbyMessageHTML(const char *msg)
{

	auto g_MatchSessionOnlineHost = g_MatchFramework->GetMatchSession();
	if (g_MatchSessionOnlineHost) {
		auto g_MatchSystem = g_MatchFramework->GetMatchSystem();
		if (g_MatchSystem)
		{
			auto g_PlayerManager = g_MatchSystem->GetPlayerManager();

			auto g_PlayerLocal = g_PlayerManager->GetLocalPlayer(0);

			KeyValues* kv = reinterpret_cast<KeyValues*>(KeyValues::operator new(36));
			if (kv)
			{
				KeyValues_Func::GameFunc_InitKeyValues(kv, "Game::ChatReportMatchmakingStatus");

				//run,all
				auto run = KeyValues_Func::KeyValues_FindKey(kv, "run", true);
				if (run)
					KeyValues_Func::KeyValues_SetString(run, "all");


				KeyValues_Func::KeyValues_SetUint64(kv, "xuid", g_PlayerLocal->GetXUIDLow(), g_PlayerLocal->GetXUIDHigh());

				//KeyValues_Func::KeyValues_SetString(kv, "error", msg);

				//status, msg
				auto chat = KeyValues_Func::KeyValues_FindKey(kv, "status", true);
				if (chat)
					KeyValues_Func::KeyValues_SetString(chat, msg);

				g_MatchSessionOnlineHost->Command(kv);

				delete kv;
			}
		}
	}
}
