DWORD FindPatternFox(std::string moduleName, std::string pattern)
{
	const char* pat = pattern.c_str();
	DWORD firstMatch = 0;
	DWORD rangeStart = (DWORD)GetModuleHandleA(moduleName.c_str());
	MODULEINFO miModInfo; GetModuleInformation(GetCurrentProcess(), (HMODULE)rangeStart, &miModInfo, sizeof(MODULEINFO));
	DWORD rangeEnd = rangeStart + miModInfo.SizeOfImage;
	for (DWORD pCur = rangeStart; pCur < rangeEnd; pCur++)
	{
		if (!*pat)
			return firstMatch;

		if (*(PBYTE)pat == '\?' || *(BYTE*)pCur == getByte(pat))
		{
			if (!firstMatch)
				firstMatch = pCur;

			if (!pat[2])
				return firstMatch;

			if (*(PWORD)pat == '\?\?' || *(PBYTE)pat != '\?')
				pat += 3;

			else
				pat += 2;    //one ?
		}
		else
		{
			pat = pattern.c_str();
			firstMatch = 0;
		}
	}
	return NULL;
}

auto meme_inviter(bool get_collection_size) -> uint16_t {
#pragma pack(push, 1)
	struct item_t {
		uint16_t idx_next_0, unk_idx_2, idx_prev_4, unk_val_6;
		uint64_t steam_id_8;
		uint32_t* unk_ptr_16;
	}; //Size: 0x0014
#pragma pack(pop)

	static const auto collection = *(uint32_t**)(FindPatternFox("client_panorama.dll", "8B 35 ? ? ? ? 66 3B D0 74 07") + 2);

	if (*collection) {
		auto invite_to_lobby = [](uint64_t id) {
			using Fn = void(__thiscall*)(uintptr_t, uint64_t);
			static const auto this_ = *(uintptr_t**)(FindPatternFox("client_panorama.dll", "83 3D ? ? ? ? ? 74 5E 8B 0D ? ? ? ? 68") + 2);
			static const auto fn = (Fn)FindPatternFox("client_panorama.dll", "55 8B EC 83 E4 F8 83 EC 1C 53 56 57 8B F1 FF 15 ? ? ? ? 8B");
			if (*this_) {
				fn(*this_, id);
			}
		};

		auto max_index = ((uint16_t*)collection)[9];

		if (get_collection_size)
			return max_index;

		for (uint16_t i = 0; i <= max_index; ++i) {
			auto item = &((item_t*)*collection)[i];
			invite_to_lobby(item->steam_id_8);
		}

		return max_index;
	}

	return 0;
}
