int __fastcall hk_GetFriendCount(void* ecx, void* edx, int iFriendFlags) {
	//std::printf("[FriendSpoof] GetFriendCount(%d);\n", iFriendFlags);

	auto friendcount = 0;

	if (iFriendFlags & k_EFriendFlagImmediate) {
		friendcount = friends.size();
	}

	//std::printf("[FriendSpoof] Friends: %d\n", friendcount);
	return friendcount;
}

void __fastcall hk_GetFriendByIndex(void* ecx, void* edx, std::uint64_t* retn, int iFriend, int iFriendFlags) {
	//std::printf("[FriendSpoof] GetFriendByIndex(%d, %d);\n", iFriend, iFriendFlags);

	auto id = k_steamIDNil;

	if (iFriendFlags & k_EFriendFlagImmediate) {
		if (iFriend >= 0 && (size_t)iFriend < friends.size()) {
			id = friends[iFriend];
		}
	}

	//std::printf("[FriendSpoof] Friend: %llu\n", id.ConvertToUint64());
	*retn = id.ConvertToUint64();
}

EPersonaState __fastcall hk_GetFriendPersonaState(void* ecx, void* edx, CSteamID steamIDFriend) {
	//std::printf("[FriendSpoof] GetFriendPersonaState(%llu);\n", steamIDFriend.ConvertToUint64());
	// Everyone is always online.
	return k_EPersonaStateOnline;
}

