static void OnSendLobbyChat(CSteamID steamIDLobby, void *pvMsgBody, int cubMsgBody)
{
	steam_id_global = steamIDLobby;
	//printf("hSendLobbyChatMsg called - Lobby: %llx, Msg addr: 0x%x\nLenght: %d\n", steamIDLobby, pvMsgBody, cubMsgBody);
	//Dump(pvMsgBody, cubMsgBody);
	//HexDumpMemory(pvMsgBody, cubMsgBody);
	//std::cout << "\n\n";

	players.clear();
	players_lobby = SDK::Interfaces::SteamMatchmaking()->GetNumLobbyMembers(steam_id_global);


	for (int i(0); i < players_lobby; i++)
	{
		auto local = SDK::Interfaces::SteamMatchmaking()->GetLobbyMemberByIndex(steam_id_global, i);
		auto xuid = local.GetStaticAccountKey();

		LobbyPlayer temp;
		temp.xuid = xuid;

		players.push_back(temp);
	}

	if (!players.empty())
	{
		local_player_xiud = players[0].xuid;
		*(uint64*)(Fox_Lobby_invite + 0x41) = _byteswap_uint64(local_player_xiud + 4294967296); //  + 4294967296 fox magic number
		*(uint64*)(Fox_Lobby_invite + 0x51) = _byteswap_uint64(76561233252013295); //76561233252013295 - steam cant load this xuid
	}

	//printf("Lobby account id %d\nMessage: %s\n", steamIDLobby.GetAccountID(), pvMsgBody);

}

EGCResults __fastcall Hook_RetrieveMessage(void* ecx, void* edx, uint32_t *punMsgType, void *pubDest, uint32_t cubDest, uint32_t *pcubMsgSize)
{
	SteamGameCoordinatorTable.UnHook();
	EGCResults status = SDK::Interfaces::SteamGameCoordinator()->RetrieveMessage(punMsgType, pubDest, cubDest, pcubMsgSize);
	SteamGameCoordinatorTable.ReHook();
	if (status != k_EGCResultOK)
		return status;

	OnRetrMsg(punMsgType, pubDest, cubDest, pcubMsgSize);

	return status;
}

void __fastcall Hook_SendLobbyChatMsg(void* ecx, void* edx, CSteamID steamIDLobby, void *pvMsgBody, int cubMsgBody)
{
	OnSendLobbyChat(steamIDLobby, pvMsgBody, cubMsgBody);
	if (!global_lobby_update_lock)
	{
		SteamMatchMakingTable.UnHook();
		SDK::Interfaces::SteamMatchmaking()->SendLobbyChatMsg(steamIDLobby, pvMsgBody, cubMsgBody);
		SteamMatchMakingTable.ReHook();
	}
	else
	{
		if (CSX::Memory::FindPattern(pvMsgBody, cubMsgBody, "00 00 35 6F 00 53 79 73 53 65 73 73 69 6F 6E 3A 3A 4F 6E 50 6C 61 79 65 72 55 70 64 61 74 65 64") || CSX::Memory::FindPattern(pvMsgBody, cubMsgBody, "00 00 35 6F 00 53 79 73 53 65 73 73 69 6F 6E 3A 3A 4F 6E 55 70 64 61 74 65"))
		{
			//std::cout << "HOOKED UPDATE!!\n\n\n";
			return;
		}
		else
		{
			SteamMatchMakingTable.UnHook();
			SDK::Interfaces::SteamMatchmaking()->SendLobbyChatMsg(steamIDLobby, pvMsgBody, cubMsgBody);
			SteamMatchMakingTable.ReHook();
			return;
		}
	}


	return;
}
